import React, { useState, useEffect } from 'react';

function TotalStoryPointBarChart() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchSP = async () => {
      try {
        const response = await fetch(`http://localhost:4000/api/available-sp`);

        if (!response.ok) {
          throw new Error('Network response was not ok');
        }

        const spdata = await response.json();
        setData(spdata); 
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchSP(); 
  }, []);

  console.log('State data:', data); // Log the state data

  return (
    <div>
      {error && <div>Error: {error.message}</div>}
      {data && (
        <div>
          {data.map(item => (
            <div key={item.id}>
              {item.id}
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default TotalStoryPointBarChart;
